import React, { Component } from "react";
import { Switch, Route } from "react-router-dom";
import "../src/css/App.css";
import Main from "./pages";

function App() {
  return (
    <Switch>
      <Route path="/" component={Main} />
    </Switch>
  );
}

export default App;
